#include <bits/stdc++.h>
using namespace std;

#define MAXN 1005

vector<bool> seen;
vector<int> G[MAXN];

void dfs(int at) {
    if (seen[at]) return;
    seen[at] = true;
    for (int to : G[at]) {
        if (!seen[to]) dfs(to);
    }
}

int main () {
    int N, K;
    cin >> N >> K;
    for (int i = 0; i < K; i++) {
        int a, b;
        cin >> a >> b;
        a--, b--;
        G[a].push_back(b);
        G[b].push_back(a);

        // count components
        int cnt = 0;
        seen.assign(N, false);
        for (int i = 0; i < N; i++) {
            if (seen[i]) continue;
            dfs(i);
            cnt++;
        }
        
        cout << cnt << endl;
    }
}

