#include <bits/stdc++.h>
using namespace std;
#define MAXA 100005

// works out the answer assuming the left divider is shorter than the right.
long long solve(vector<long long> &hs) {
    int N = (int)hs.size();

    // for each height, work out the furthest to the right divider 
    // that is >= than it. set it to -1 if such a divider does not exist.
    vector<int> right(MAXA);
    int r = N-1;
    for (long long height = 1; height < MAXA; height++) {
        while (r >= 0 && hs[r] < height) r--;
        right[height] = r;
    }

    // for each divider, work out what the max area is if it is the left divider.
    long long best = 0;
    for (int i = 0; i < N; i++) {
        if (right[hs[i]] <= i) continue;
        long long width = right[hs[i]] - i;
        long long height = hs[i];
        best = max(best, width * height);
    }
    return best;
}

int main () {
    int N;
    cin >> N;
    vector<long long> hs(N);
    for (int i = 0; i < N; i++) cin >> hs[i];

    long long res1 = solve(hs);
    reverse(hs.begin(), hs.end());
    long long res2 = solve(hs);

    // cout << res1 << ' ' << res2 << endl;

    cout << max(res1, res2) << endl;
}

