int main(int argc, const char * argv[]) {
   
    int a, b;
    scanf("%d%d", &a, &b);
    
    for(int i = a; i <= b; i++) {
        int pom = i;
        int zbir = 0;
        while(pom > 0) {
            int cifra = pom % 10;
            zbir += cifra;
            pom /= 10;
        }
        printf("%d ", zbir);
    }
    return 0;
}

// Product
class Pizza {
  public dough: string = '';
  public sauce: string = '';
  public toppings: string[] = [];
  public extraCheese: boolean = false;
  public doubleBaked: boolean = false;
  
  public show(): void {
    console.log(`Pizza with ${this.dough} dough, ${this.sauce} sauce, toppings: ${this.toppings.join(', ')}, extra cheese: ${this.extraCheese}, double baked: ${this.doubleBaked}`);
  }
}

// Builder Interface
interface PizzaBuilder {
  buildDough(): void;
  buildSauce(): void;
  buildToppings(): void;
  addExtraCheese(): void;
  addDoubleBaked(): void;
  getResult(): Pizza;
}

// ConcreteBuilder for Margherita Pizza
class MargheritaPizzaBuilder implements PizzaBuilder {
  private pizza: Pizza = new Pizza();
  
  public buildDough(): void {
    this.pizza.dough = 'Thin Crust';
  }
  
  public buildSauce(): void {
    this.pizza.sauce = 'Tomato';
  }
  
  public buildToppings(): void {
    this.pizza.toppings = ['Mozzarella'];
  }
  
  public addExtraCheese(): void {
    this.pizza.extraCheese = true;
  }
  
  public addDoubleBaked(): void {
    this.pizza.doubleBaked = true;
  }
  
  public getResult(): Pizza {
    return this.pizza;
  }
}

// ... (PepperoniPizzaBuilder and VeggiePizzaBuilder would be similar but with different implementations for each method)

// Director
class PizzaDirector {
  private builder: PizzaBuilder;
  
  constructor(builder: PizzaBuilder) {
    this.builder = builder;
  }
  
  public construct(extraCheese: boolean = false, doubleBaked: boolean = false): void {
    this.builder.buildDough();
    this.builder.buildSauce();
    this.builder.buildToppings();
    if (extraCheese) {
      this.builder.addExtraCheese();
    }
    if (doubleBaked) {
      this.builder.addDoubleBaked();
    }
  }
}

// Client Code
const margheritaBuilder: PizzaBuilder = new MargheritaPizzaBuilder();
const director: PizzaDirector = new PizzaDirector(margheritaBuilder);

director.construct(true, false);  // extra cheese, not double-baked
const margheritaPizza: Pizza = margheritaBuilder.getResult();
margheritaPizza.show(); // Output: Pizza with Thin Crust dough, Tomato sauce, toppings: Mozzarella, extra cheese: true, double baked: false

