#include <bits/stdc++.h>
using namespace std;
vector<int> suffixArray(string s) {
    s.push_back(0);
    int cnt = 0, cl = 0;
    vector<int> c(s.size()), p(s.size());
    map<int, vector<int>> mp;
    for (int i = 0; i < (int)s.size(); ++i)
        mp[s[i]].push_back(i);
    for (auto& e : mp) {
        for (auto u : e.second) {
            c[u] = cl, p[cnt++] = u;
        }
        cl++;
    }
    for (int step = 1; cl < (int)s.size(); ++step) {
        vector<vector<int>> csort(cl);
        vector<int> cp(s.size());
        int d = 1 << step - 1;
        int clh = cnt = 0;
        for (int i = 0; i < (int)s.size(); ++i)
            csort[c[(p[i] - d + (int)s.size()) % (int)s.size()]].push_back((p[i] - d + (int)s.size()) % (int)s.size());
        for (int i = 0; i < cl; ++i) {
            for (int j = 0; j < (int)csort[i].size(); ++j) {
                if (!j || c[(csort[i][j] + d) % (int)s.size()] - c[(csort[i][j - 1] + d) % (int)s.size()])
                    clh++;
                cp[csort[i][j]] = clh - 1;
                p[cnt++] = csort[i][j];
            }
        }
        c = move(cp);
        cl = clh;
    }
    return p;
}
vector<int> lcp(string s) {
    auto x = suffixArray(s);
    x.erase(x.begin());
    vector<int> bck(s.size()), lcp((int)s.size() - 1);
    for (int i = 0; i < (int)s.size(); ++i)
        bck[x[i]] = i;
    for (int i = 0, l = 0; i < (int)s.size(); ++i) {
        if (l > 0)
            l--;
        if (bck[i] == (int)s.size() - 1) {
            l = 0;
            continue;
        }
        int j = x[bck[i] + 1];
        while (max(i, j) + l < (int)s.size() && s[i + l] == s[j + l])
            l++;
        lcp[bck[i]] = l;
    }
    return lcp;
}

signed main() {
    cin.tie(0)->sync_with_stdio(0);
    string s;
    cin >> s;
    auto x = lcp(s);
    cout << s.size() * s.size() - accumulate(x.begin(), x.end(), 0ll) - (s.size() - 1) * s.size() / 2;
}

