using System;

namespace Avtoservice
{
    public class Verificator
    {
        private int _money;
        private int _penalty;
        private int _gearNumber;
        private int _totalRepairCost;
        public bool IsVerified { get; private set; }
        
        public Verificator()
        {
            _money = Constants.AvtoserviseStartMoney;
            _penalty = Constants.PenaltyCost;
        }
        
       public bool CheckInputNumber(Client newClient, int gearCount, Gear gear, int totalRepairCost)
       {
           bool check = false;
            
            string userInput = Console.ReadLine();
            _totalRepairCost = totalRepairCost;

            if (int.TryParse(userInput, out int gearNumber))
            {
                _gearNumber = gearNumber;
                CheckGearNumber(newClient, gearCount, gear);
                check = true;
            }

            else
            {
                Console.WriteLine("Не верный ввод! Повторите снова.");
            }

            return check;
       }
       
       public int GetMoney()
       {
           return _money;
       }

       private void CheckGearNumber(Client newClient, int gearCount, Gear gear)
        {
            if (_gearNumber >= 0 && _gearNumber < gearCount && _gearNumber == newClient.RequiredGear) 
            {
                IsRanOut(newClient, gear);
            }
            else
            {
                Console.WriteLine($"Вы сами не знаете какую деталь предложить клиенту. Он разозлился и ушел. " +
                                  $"Вы заплатили штраф {_penalty} руб.");
                _money -= _penalty;
            }
        }

        private void IsRanOut(Client newClient, Gear gear)
        {
            if (gear.IsRanOut)
            {
                Console.WriteLine($"Вы предложили клиенту Деталь, которой нет на складе. Клиент разозлился и ушел. " +
                                  $"Вы заплатили штраф - {_penalty / 2} руб.");
                _money -= _penalty / 2;
            }
            else
            {
                if (CheckSolvency(newClient))
                {
                    IsVerified = true;
                }
                else
                {
                    IsVerified = false;
                }
            }
        }

        private bool CheckSolvency(Client newClient)
        {
            bool check = false;
            if (newClient.Pay(_totalRepairCost) > 0)
            {
                Console.WriteLine($"Клиент пересчитав деньги, оплатил ремонт и замену Детали -{_gearNumber}-. Заплатил {_totalRepairCost} руб.");
                _money += newClient.Pay(_totalRepairCost);
                check = true;
            }
            
            else
            {
                Console.WriteLine("У клиента не хватило денег и он ушел.");
            }

            return check;
        }
    }
}
